import React from 'react';
import Sidebar from '../components/Sidebar'; // Make sure the import path is correct

const UserHome = () => {
  const handleLogout = () => {
    // Logic to handle user logout, e.g., clear user data, redirect to login page
    console.log('Logout');
  };

  return (
    <div style={{ display: 'flex' }}>
      <div className='sidebarDiv' style={{
        height: '100vh',
        width: '15%'
      }}>
        <Sidebar onLogout={handleLogout} />
      </div>
      <div style={{ flex: 1, padding: '20px' }}>
        <h1 style={{ color: 'white'}}>Welcome to Your Dashboard</h1>
        <p>This is your personal dashboard. From here, you can access all the features available to you.</p>
      </div>
    </div>
  );
};

export default UserHome;
